package managers;import org.openqa.selenium.WebDriver;import pageObjects.CurrencyConversionPage;import pageObjects.CurrencyConversionResultPage;public class PageObjectManager {    private final WebDriver webDriver;    private CurrencyConversionPage currencyConversionPage;    private CurrencyConversionResultPage currencyConversionResultPage;    public PageObjectManager(WebDriver webDriver) {        this.webDriver = webDriver;    }    public CurrencyConversionPage getCurrencyConversionPage(){        return (currencyConversionPage == null) ? currencyConversionPage = new CurrencyConversionPage(webDriver) : currencyConversionPage;    }    public CurrencyConversionResultPage getCurrencyConversionResultPage(){        return (currencyConversionResultPage == null) ? currencyConversionResultPage = new CurrencyConversionResultPage(webDriver) : currencyConversionResultPage;    }}